DROP TRIGGER IF EXISTS `prevent_order_delete`$$
CREATE TRIGGER `prevent_order_delete` BEFORE DELETE ON `CustomerOrder`
FOR EACH ROW
BEGIN
    SIGNAL SQLSTATE '45000' 
    SET MESSAGE_TEXT = 'Sécurité : Impossible de supprimer une commande.';
END$$

DROP TRIGGER IF EXISTS `secure_order_update`$$
CREATE TRIGGER `secure_order_update` BEFORE UPDATE ON `CustomerOrder`
FOR EACH ROW
BEGIN
    IF NEW.total_amount != OLD.total_amount THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Fraude : Interdiction de modifier le montant d\'une commande enregistrée.';
    END IF;

    IF NEW.order_date != OLD.order_date THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Fraude : Interdiction de changer la date de commande.';
    END IF;

    IF NEW.id_Customer != OLD.id_Customer THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Sécurité : Une commande ne peut pas être transférée à un autre client.';
    END IF;

    IF NEW.id_Image != OLD.id_Image THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Intégrité : Impossible de changer le produit (mosaïque) d\'une commande existante.';
    END IF;

END$$

DELIMITER ;

